import Nav1 from "./Nav123";
import BoardItem from "./BoardItem";
const Main = () => {
  return (
    <div>
      <h1>메인 페이지</h1>
      <div className="board">
        <h2>게시판</h2>
        <BoardItem
          title="첫 번째 게시글"
          content="이것은 첫 번째 게시글의 내용입니다."
          time="2024-05-12 10:00"
          views={100}
          comments={5}
        />
        <BoardItem
          title="두 번째 게시글"
          content="이것은 두 번째 게시글의 내용입니다."
          time="2024-05-11 15:30"
          views={50}
          comments={3}
        />
        {/* 추가적으로 게시판 아이템을 더 넣을 수 있습니다 */}
      </div>
      <Nav1 />
    </div>
  );
};

export default Main;
